const CommentsList = ({ comments }) => (
    <>
        <h3>Comments:</h3>
        {comments.map(comment => (
            <div className="comment" key={`${comment.postedBy+Math.random(1000)}:${comment.text.text}`}>
                <h4>{typeof comment.postedBy === 'object' ? comment.postedBy.postedBy : comment.postedBy}</h4>
                <p>{comment.text.text}</p>
            </div>
        ))}
    </>
);

export default CommentsList;
